package main

import (
	"fmt"
	"strconv"
	"strings"
)

func main() {
	input := ""
	signal := strings.Repeat(input, 10000)
	offset, _ := strconv.Atoi(signal[:7])
	var output []int

	for _, r := range signal[offset:] {
		output = append(output, int(r-'0'))
	}

	for p := 0; p < 100; p++ {
		sum := 0
		for i := len(output) - 1; i >= 0; i-- {
			sum += output[i]
			output[i] = sum % 10
		}
	}
	fmt.Println(output[:8])
}